import React from "react";

export const AppointmentTile = ({ title, contact, date, time, reason }) => (
  <div>
    <h3>{title}</h3>
    <p>Contact: {contact}</p>
    <p>Date: {date}</p>
    <p>Time: {time}</p>
    <p>Reason: {reason}</p>
  </div>
);
